import React from "react";
import { connect } from 'react-redux'
import * as actions from "../store/actions/index";

const Accessories = () => {

  props.fetchAccessories("Accessory")
  return <div className='brands-title'>coming soon...</div>;
};

const mapStateToProps = (state) => {
  return { products: state.products.select }
}

const mapDispatchToProps = (dispatch) => {
  return {
    fetchAccessories: (category) => dispatch(actions.fetchProdByCategory(category))
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(Accessories);
